import Banner from "./banner";
import { Box,styled } from "@mui/material";

const StyleBox = styled(Box)`
padding:20px 10px;
background:#F2F2F2;
`;
const Home= ()=>{
    return (
    <>
    <StyleBox>
    <Banner/>
    </StyleBox>
    </>
    )
}

export default Home;
